def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if item <= bins[i]/3:
            if item % 3 == 0:
                priorities[i] = np.log(item + 2) / bins[i]
            elif item % 3 == 1:
                priorities[i] = np.square(item + 3) / bins[i]
            else:
                priorities[i] = np.cbrt(item + 4) / bins[i]
        elif item > bins[i]/3 and item <= bins[i]*0.75:
            if bins[i] % 4 == 0:
                priorities[i] = np.power(item / bins[i], 1.6) + np.log1p(item / bins[i])
            else:
                priorities[i] = np.power(item / bins[i], 0.9) + np.log2(item / bins[i])
        else:
            if item % 5 == 0:
                priorities[i] = np.log1p(item / bins[i]) + np.exp(item / bins[i])
            elif item % 5 == 1:
                priorities[i] = np.tan(item / bins[i]) + np.cbrt(item / bins[i])
            elif item % 5 == 2:
                priorities[i] = np.sqrt(np.sin(item) / bins[i]) + np.square(item / bins[i])
            elif item % 5 == 3:
                priorities[i] = np.log10(item / bins[i]) + np.tanh(item / bins[i])
            else:
                priorities[i] = np.log2(item / bins[i]) + np.exp(np.tan(item) / bins[i])

    return priorities
